    function initMapDiskannak() {

    const map = document.getElementById('garut-map');

    if (!map) return;

    console.log('Map Ready');

    // contoh: semua wilayah bisa di klik
    const paths = map.querySelectorAll('path');

    paths.forEach(function(p){
        p.addEventListener('click', function(){
            alert('Wilayah diklik');
        });
    });
}

//  penting untuk filament
document.addEventListener('livewire:navigated', initMapDiskannak);

//  juga jalankan saat pertama load
document.addEventListener('DOMContentLoaded', initMapDiskannak);
